module.exports = JSON.parse('{"script":{"type":"sitcom","title":"Big Bang Theory","lang":"en-US","cast":[{"id":"sheldon","displayName":"Sheldon"},{"id":"leonard","displayName":"Leonard"}],"sections":[{"number":"1","lines":[{"characterId":"sheldon","text":"Buona sera, Luigis Pizza. Buona sera. It means good evening in Italian. May I say, having to explain that to you calls into question the authenticity of your ristorante?"},{"characterId":"leonard","text":"Okay, Im out of here."},{"characterId":"sheldon","text":"Un momento. Oh, for heavens sake, now youre being deliberately stupid. Where are you going?"},{"characterId":"leonard","text":"Im having dinner with Priya at Rajs. I think Howards going to be there. You want to join us?"},{"characterId":"sheldon","text":"But tonights Thursday. On Thursdays, everybody comes over here and has pizza. Or a reasonable facsimile prepared by someone claiming to be Luigi, but who sounds suspiciously like Jackie Chan."},{"characterId":"leonard","text":"Cant we make a one-time exception for tonight?"},{"characterId":"sheldon","text":"We could. We could also stop using the letter M, but I think that idea is isguided and oronic."},{"characterId":"leonard","text":"Just come with me to Rajs."},{"characterId":"sheldon","text":"Well, I dont want to go to a party."},{"characterId":"leonard","text":"Its not a party. Its the same group of people who hang out here, hanging out over there."},{"characterId":"sheldon","text":"Im sorry, but five people eating and chatting is a party."},{"characterId":"leonard","text":"How come its not a party when we do it here?"},{"characterId":"sheldon","text":"Because we dont throw parties."},{"characterId":"leonard","text":"I dont know what to tell you, Sheldon. Im going to see Priya. Everyones over there. You coming or not?"},{"characterId":"sheldon","text":"Well, no, sir, and do you know why? In a word, tradition. Every Thursday night for the last eight years, you and I and our friends have gathered here in this very spot to break bread covered with cheese and sauce, discuss the issues of the day, and yes, share a laugh or two. But I guess our rich heritage means nothing to you."},{"characterId":"leonard","text":"I guess youre right. See you later."},{"characterId":"sheldon","text":"Wait! Leonard! Wait! What am I going to do for dinner?"},{"characterId":"leonard","text":"Come with me to Rajs and eat there."},{"characterId":"sheldon","text":"I cant do that. What if he serves haggis and blood pudding?"},{"characterId":"leonard","text":"I really doubt thats what hell serve."},{"characterId":"sheldon","text":"But what if he does? Ill be obliged to dine on liver and lungs stuffed in a sheeps stomach. And frankly, blood pudding is essentially the same thing. I dont know why hes serving both."},{"characterId":"leonard","text":"What do you want to do? You want to come with me, or do you want to sit here alone?"},{"characterId":"sheldon","text":"No, Ill go to your haggis party. But Im telling you, this is adness. This is utter and coplete adness."}]}]}}');

